  \"2016-07-25T22:03:53.034462\",\n\t\"name\": \"bottom-dissolved-oxygen-maps-from-seamap-summer-groundfish-shrimp-surveys\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bottom dissolved oxygen (DO) data was extracted
  from environmental profiles acquired during the Southeast Fisheries Science Center
  Mississippi Laboratories summer groundfish trawl surveys of the Western and North-central
  Gulf of Mexico from 1982 to 1998. The data were distributed to hypoxia researchers
  in near real time and used to generate bottom DO maps as part of the Hypoxia Watch
  Project (http://www.ncddc.noaa.gov/hypoxia/). The profiles were acquired with a
  Sea-Bird Model SB9 profiler equipped with pressure, temperature, conductivity, fluorescence,
  and beam transmission sensors. The data were processed with Sea-Bird software using
  the standard processing protocol developed by the Mississippi Laboratories. Water
  temperature, beam transmission, and derived salinity, DO and DO percent saturation,
  and density were retained in the processed files. SAS software was used to extract
  the bottom DO and other relevant data (e.g., date, time, position, and station number)
  and format the data as comma-delimited ASCII files.\",\n\t\"license_title\": null,\n\t\"extras\":
